import React from 'react'
import { Routes, Route } from 'react-router-dom';
import { Link } from 'react-router-dom';
import Login from './Login';

function Main() {
  return (
    <>

    <div className='100-w vh-100 bg-black'>
        <Link to="/fig" href='' className='ms-2'>Sign in</Link>
    </div>

    <Routes>
    <Route path="/main/fig" element={<Login/>}></Route>
    </Routes>

    </>

  );
}

export default Main;
